sympy.sympy.core.traversal._preorder_tra:
def _preorder_traversal(self, node, keys):
    yield node
    if self._skip_flag:
        self._skip_flag = False
        return
    if isinstance(node, Basic):
        if not keys and hasattr(node, '_argset'):
            # LatticeOp keeps args as a set. We should use this if we
            # don't care about the order, to prevent unnecessary sorting.
            args = node._argset
        else:
            args = node.args
        if keys:
            if keys != True:
                args = ordered(args, keys, default=False)
            else:
                args = ordered(args)
        for arg in args:
            yield from self._preorder_traversal(arg, keys)
    elif iterable(node):
        for item in node:
            yield from self._preorder_traversal(item, keys)

sympy.sympy.polys.agca.extensions.__eq__:
def __eq__(self, other):
    if not isinstance(other, FiniteExtension):
        return False
    return self.modulus == other.modulus

sympy.sympy.polys.domains.algebraicfield:
def __eq__(self, other):
    """Returns ``True`` if two domains are equivalent. """
    if isinstance(other, AlgebraicField):
        return self.dtype == other.dtype and self.ext == other.ext
    else:
        return NotImplemented

